import React from 'react'
import { useState, useEffect } from 'react';


export default function MisPeliculas() {

    const [nombre, setNombre] = useState('');
    const lista = [];


    function getData(){
        return localStorage.getItem('nombre');
    }
    
    useEffect (() =>{                              
        
        setNombre(getData());
        lista.push(nombre)                         
        
    }, [lista, nombre]);

    console.log('LISTA: ', lista);
  return (
    <div>
        <h3>{nombre}</h3>
        <h3>{lista}</h3>
    </div>
  )
}
